sys_variable_value.value:
(function execute(inputs, outputs) {
  if (inputs.status_code == '200') {
    outputs.status = "Success";

    outputs.response = inputs.response;
  } else {
    outputs = new BoxErrorHandler().userErrorHandler(inputs, outputs);
  }

  outputs.response = inputs.response;
})(inputs, outputs);

